// Função de busca por código
export function findCID10ByCode(code: string): CID10Code | undefined {
  return cid10Codes.find(c => c.code.toLowerCase() === code.toLowerCase());
}

// Função de busca por descrição (case insensitive)
export function searchCID10(query: string): CID10Code[] {
  const normalizedQuery = query.toLowerCase().normalize('NFD').replace(/[\u0300-\u036f]/g, '');
  return cid10Codes.filter(c => {
    const normalizedDesc = c.description.toLowerCase().normalize('NFD').replace(/[\u0300-\u036f]/g, '');
    return normalizedDesc.includes(normalizedQuery) || c.code.toLowerCase().includes(normalizedQuery);
  });
}

// Função para obter códigos por categoria
export function getCID10ByCategory(category: string): CID10Code[] {
  return cid10Codes.filter(c => c.category === category);
}

